Review:
주머니 구멍.;;; 배송이 아주 느려서... 취소할려다가 기다렷더니.;;
 아니나 다를까.;;; ㅇ ㅏ.;.; 주머니에... 손이 그냥 들락날락하는 구멍이.;;
 이게 왠말입니까.;;;돈을 넣엇는데 없어서 주먼니보니 구멍이 나서 휴..ㅜㅜ;;;
 반품이나 교품받을려고 햇으나 또 기다리는 시간 아까워서.. 바느질 합니다.;;;

별루..... 배송이 일주일 넘게 걸렸음...
뜯으면 환불불가라는 기분나쁜 스티커와..
하단에 있는 줄에 달려있는 메달 이 깨짐..;;
불량품을 줘놓고서 뜯으면 환불불가는 뭥미...;
털은 완전 많이 빠짐..;;;

그냥 그래요... 사실 디자인은 참 예쁜데...
모자도 너무 축 쳐져있어서 모양이 안예쁘고...
무엇보다 안감이 너무 잘 튿어져요;
너무 약한건지;
벌써 너덜너덜;;;;
